import React from "react";
import ReactRotatingText from "react-rotating-text";
import Container from "../components/Container";

const index = () => {
  return (
    <Container>
      <p>Hi,</p>
      <h1>I'm Dani Vijay</h1>
      <p>Your friendly neighborhood Full Stack Web Developer</p>
      <p>
        I love working with JavaScript, there is a high chance of finding me
        working with MERN stack at the moment.
      </p>
      <h2>
        I've worked extensively with ReactJS, Node with ExpressJS, VueJS, Ruby
        on Rails, MongoDB and MySQL.
      </h2>
      <p>
        I'm fascinated about new technologies, and love to put them in my
        arsenal for timely disposal. I'm more than happy to learn stuff to
        improve my projects. I also have some experience working with{" "}
        <ReactRotatingText
          items={[
            "Lambda Functions",
            "VueJS",
            "PHP",
            "Bash",
            "Firebase",
            "AWS API Gateway",
            "Heroku",
            "Netlify",
            "Apache Server",
            "Nginx",
            "DNS Management",
            "Gatsby",
            "NextJS"
          ]}
        />
      </p>
    </Container>
  );
};

export default index;
